import React from 'react';
import Card from './Card';

export default function Index(props) {
    return (
      <div className='card-group'>
        <Card data={props.data} day='Monday'/>
        <Card data={props.data} day='Tuesday'/>
        <Card data={props.data} day='Wednesday'/>
        <Card data={props.data} day='Thursday'/>
        <Card data={props.data} day='Friday'/>
      </div>
    );
  }
